import React, { useState } from 'react';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';
import { SunFill, MoonFill } from 'react-bootstrap-icons';
import { motion } from 'framer-motion';

const LayoutWithSidebar = () => {
  const [darkMode, setDarkMode] = useState(false);

  const toggleDarkMode = () => {
    const newMode = !darkMode;
    setDarkMode(newMode);
    document.body.classList.toggle('dark-mode', newMode);
  };

  return (
    <div style={{ display: 'flex', minHeight: '100vh', overflow: 'hidden' }}>

      {/* ===== Sidebar ===== */}
      <div
        style={{
          width: '220px',
          backgroundColor: '#000',
          color: '#fff',
          display: 'flex',
          flexDirection: 'column',
          padding: '20px',
        }}
      >
        <h3 className="mb-4">Brand</h3>
        <Button
          variant="outline-light"
          onClick={toggleDarkMode}
          className="mb-3"
        >
          {darkMode ? <SunFill className="me-2" /> : <MoonFill className="me-2" />}
          {darkMode ? 'Light Mode' : 'Dark Mode'}
        </Button>
        <nav style={{ flexGrow: 1 }}>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            <li className="mb-2"><a href="#" style={{ color: '#fff', textDecoration: 'none' }}>Dashboard</a></li>
            <li className="mb-2"><a href="#" style={{ color: '#fff', textDecoration: 'none' }}>3D Scene</a></li>
            <li className="mb-2"><a href="#" style={{ color: '#fff', textDecoration: 'none' }}>Features</a></li>
          </ul>
        </nav>
        <p className="mt-auto text-muted" style={{ fontSize: '12px' }}>Â© 2025 YourApp</p>
      </div>

      {/* ===== Main Content ===== */}
      <div
        style={{
          flexGrow: 1,
          backgroundColor: darkMode ? '#121212' : '#f9fafb',
          padding: '40px',
          overflowY: 'auto',
        }}
      >
        <Container fluid>
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
          >
            <Row className="mb-4">
              <Col>
                <h1 className="fw-bold">Main Content</h1>
                <p className="text-muted">
                  This is your main content area, placed next to a fixed sidebar.
                </p>
              </Col>
            </Row>

            <Row>
              <Col md={6}>
                <Card className="mb-4">
                  <Card.Body>
                    <h5>Card 1</h5>
                    <p>Some example content.</p>
                  </Card.Body>
                </Card>
              </Col>
              <Col md={6}>
                <Card className="mb-4">
                  <Card.Body>
                    <h5>Card 2</h5>
                    <p>More example content.</p>
                  </Card.Body>
                </Card>
              </Col>
            </Row>
          </motion.div>
        </Container>
      </div>
    </div>
  );
};

export default LayoutWithSidebar;
